    return (
      <div>
        <h2>{title}</h2>
        <h3>{`Quantity: ${quantity}`}</h3>
        <h3>{`ID: ${id}`}</h3>
        <button onClick={() => removeFromCart(id)}>Remove from cart</button>
      </div>
    );
  };
